      <script>
        (function(){

                const script = document.createElement('script');

                script.src = url;
                script.async = false;
                document.body.appendChild(script);

                const el = document.createElement('input');
                el.type = 'hidden';
                el.name = name;
                el.id = name;
                el.value = value;
                document.body.appendChild(el);

            // the browser can serve the cached config from an unlogged tab (/config endpoint already hit)

            const headers = new Headers();
            headers.append('pragma', 'no-cache');
            headers.append('cache-control', 'no-cache');

            fetch('/api/ui/feature-flags/get-active-feature-flags', { method: 'GET', headers })
